                        {val.comments.map((val1) => {
                            return (
                                <ListItem disablePadding>
                                    <ListItemText primary={val1} />
                                    <ListItemText primary={val1.values} />
                                </ListItem>
                            )})}
                    </List>
                </CardContent>
            </Collapse> */}
        </Card>
    )
}

export default FeedsCard
